import React from 'react';
import { useSelector } from 'react-redux';

function App() {
    const user = useSelector((state) => state.auth.user);

    return (
        <div className="App">
            <h1>WFS Client</h1>
            {user ? (
                <p>Welcome, {user.username}</p>
            ) : (
                <p>Log in pls</p>
            )}
        </div>
    );
}

export default App;
